import Games from "../pages/Games";
import News from "../pages/News";

// Declarando as rotas para renderizar os item de acordo com a rota
const routesHeader = [
  {
    name: "Home",
    path: "/",
    component: <Games />,
  },
  {
    name: "News",
    path: "/news",
    component: <News />,
  },
  {
    name: "Settings",
    path: "/settings",
  },
];

const routesSidebar = [
  {
    name: "My Account",
    path: "/account",
  },
  {
    name: "All Games",
    path: "/",
  },
  {
    name: "My Library",
    path: "/library",
  },
];

const routes = [...routesHeader, ...routesSidebar];
export { routesHeader, routesSidebar, routes };
